INSERT INTO `transports` VALUES (1,'Car','The most popular way of transportation for most people. The popularity on roads and misuse results in dangerous situations in high speeds.',NULL),(2,'Bus','One of the safest ways to travel to work/school. Professional drivers and big vehicles makes a difference in daily commute.',NULL),(3,'Train','A relatively safe way to transport huge masses of people in the city. Accidents happen rarely, but when occurred the consequences are severe.',NULL),(4,'Airplane','Safest way of travelling long distances. The picture given in media and in people´s minds is often exaggerated.',NULL),(5,'Bicycle','Fast way to move without interfering the traffic, yet dangerous thanks to the combination of speed and the lack of protection.',NULL),(6,'Ferry','Used in short or medium distances between places in coastal area. It is usually safe and accidents are rare, but when they do happen, they are very serious',NULL),(7,'Motorcycle','In many ways the most dangerous way of transportation. High speeds and lesser cover compared to cars equals more accidents.',NULL),(8,'Walking','While a healthy way to travel small distances, it is one of the riskiest way since it is also the slowest.',NULL);
